(3, 'Belajar berteman ala non non biyori', 'belajar-berteman-ala-non-non-biyori', '925908rhr.gif', '<p><b style=\"color: rgb(32, 33, 34); font-family: sans-serif;\">Perang Dunia&nbsp;II</b><span style=\"color: rgb(32, 33, 34); font-family: sans-serif;\">&nbsp;atau&nbsp;</span><b style=\"color: rgb(32, 33, 34); font-family: sans-serif;\">Perang Dunia Kedua</b><span style=\"color: rgb(32, 33, 34); font-family: sans-serif;\">&nbsp;(biasa disingkat menjadi&nbsp;</span><b style=\"color: rgb(32, 33, 34); font-family: sans-serif;\">PDII</b><span style=\"color: rgb(32, 33, 34); font-family: sans-serif;\">&nbsp;atau&nbsp;</span><b style=\"color: rgb(32, 33, 34); font-family: sans-serif;\">PD2</b><span style=\"color: rgb(32, 33, 34); font-family: sans-serif;\">) adalah sebuah&nbsp;</span><a href=\"https://id.wikipedia.org/wiki/Perang\" title=\"Perang\" style=\"text-decoration-line: none; color: rgb(6, 69, 173); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-family: sans-serif;\">perang</a><span style=\"color: rgb(32, 33, 34); font-family: sans-serif;\">&nbsp;global yang berlangsung mulai tahun 1939 sampai 1945. Perang ini melibatkan&nbsp;</span><a href=\"https://id.wikipedia.org/wiki/Peserta_Perang_Dunia_II\" class=\"mw-redirect\" title=\"Peserta Perang Dunia II\" style=\"text-decoration-line: none; color: rgb(6, 69, 173); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-family: sans-serif;\">banyak sekali negara di dunia</a><span style=\"color: rgb(32, 33, 34); font-family: sans-serif;\">&nbsp;—termasuk semua&nbsp;</span><a href=\"https://id.wikipedia.org/wiki/Kekuatan_besar\" title=\"Kekuatan besar\" style=\"text-decoration-line: none; color: rgb(6, 69, 173); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-family: sans-serif;\">kekuatan besar</a><span style=\"color: rgb(32, 33, 34); font-family: sans-serif;\">—yang pada akhirnya membentuk dua aliansi&nbsp;</span><a href=\"https://id.wikipedia.org/wiki/Militer\" title=\"Militer\" style=\"text-decoration-line: none; color: rgb(6, 69, 173); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-family: sans-serif;\">militer</a><span style=\"color: rgb(32, 33, 34); font-family: sans-serif;\">&nbsp;yang saling bertentangan:&nbsp;</span><a href=\"https://id.wikipedia.org/wiki/Sekutu_pada_Perang_Dunia_II\" class=\"mw-redirect\" title=\"Sekutu pada Perang Dunia II\" style=\"text-decoration-line: none; color: rgb(6, 69, 173); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-family: sans-serif;\">Sekutu</a><span style=\"color: rgb(32, 33, 34); font-family: sans-serif;\">&nbsp;dan&nbsp;</span><a href=\"https://id.wikipedia.org/wiki/Blok_Poros\" title=\"Blok Poros\" style=\"text-decoration-line: none; color: rgb(6, 69, 173); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-family: sans-serif;\">Poros</a><span style=\"color: rgb(32, 33, 34); font-family: sans-serif;\">. Perang ini merupakan perang terluas dalam sejarah yang melibatkan lebih dari 100 juta orang di berbagai pasukan&nbsp;</span><a href=\"https://id.wikipedia.org/wiki/Militer\" title=\"Militer\" style=\"text-decoration-line: none; color: rgb(6, 69, 173); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-family: sans-serif;\">militer</a><span style=\"color: rgb(32, 33, 34); font-family: sans-serif;\">. Dalam keadaan \"</span><a href=\"https://id.wikipedia.org/wiki/Perang_total\" title=\"Perang total\" style=\"text-decoration-line: none; color: rgb(6, 69, 173); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-family: sans-serif;\">perang total</a><span style=\"color: rgb(32, 33, 34); font-family: sans-serif;\">\", negara-negara besar memaksimalkan seluruh kemampuan ekonomi, industri, dan ilmiahnya untuk keperluan perang, sehingga menghapus perbedaan antara sumber daya sipil dan militer. Ditandai oleh sejumlah peristiwa penting yang melibatkan kematian massal warga sipil, termasuk&nbsp;</span><a href=\"https://id.wikipedia.org/wiki/Holocaust\" class=\"mw-redirect\" title=\"Holocaust\" style=\"text-decoration-line: none; color: rgb(6, 69, 173); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-family: sans-serif;\">Holocaust</a><span style=\"color: rgb(32, 33, 34); font-family: sans-serif;\">&nbsp;dan&nbsp;</span><a href=\"https://id.wikipedia.org/wiki/Pengeboman_atom_Hiroshima_dan_Nagasaki\" class=\"mw-redirect\" title=\"Pengeboman atom Hiroshima dan Nagasaki\" style=\"text-decoration-line: none; color: rgb(6, 69, 173); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-family: sans-serif;\">pemakaian senjata nuklir dalam peperangan</a><span style=\"color: rgb(32, 33, 34); font-family: sans-serif;\">, perang ini memakan korban jiwa sebanyak&nbsp;</span><a href=\"https://id.wikipedia.org/wiki/Korban_Perang_Dunia_II\" class=\"mw-redirect\" title=\"Korban Perang Dunia II\" style=\"text-decoration-line: none; color: rgb(6, 69, 173); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-family: sans-serif;\">50 juta sampai 70 juta jiwa</a><span style=\"color: rgb(32, 33, 34); font-family: sans-serif;\">. Jumlah kematian ini menjadikan Perang Dunia II&nbsp;</span><a href=\"https://id.wikipedia.org/wiki/Daftar_perang_dan_bencana_menurut_korban_jiwa\" title=\"Daftar perang dan bencana menurut korban jiwa\" style=\"text-decoration-line: none; color: rgb(6, 69, 173); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-family: sans-serif;\">konflik paling mematikan</a><span style=\"color: rgb(32, 33, 34); font-family: sans-serif;\">&nbsp;sepanjang&nbsp;</span><a href=\"https://id.wikipedia.org/wiki/Sejarah_dunia\" title=\"Sejarah dunia\" style=\"text-decoration-line: none; color: rgb(6, 69, 173); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-family: sans-serif;\">sejarah umat manusia</a><span style=\"color: rgb(32, 33, 34); font-family: sans-serif;\">.</span><sup id=\"cite_ref-3\" class=\"reference\" style=\"line-height: 1; unicode-bidi: isolate; white-space: nowrap; font-size: 11.2px; color: rgb(32, 33, 34); font-family: sans-serif;\"><a href=\"https://id.wikipedia.org/wiki/Perang_Dunia_II#cite_note-3\" style=\"text-decoration-line: none; color: rgb(6, 69, 173); background: none;\">[1]</a></sup><br><br><img src=\"data:image/jpeg;base64,\" style=\"width: 498.172px; height: 498.172px;\" data-filename=\"Katyusha.(GIRLS.und.PANZER).full.1397778.jpg\"><br></p>', 1, 1, '2022-6-23', '2022-07-22 18:19:14', '2022-07-22 18:32:47');
