(4, 'Battle keren ala Vivy', 'battle-keren-ala-vivy', '843344bd9d1f44055fb98e97840027b5cf6803.jpg', '<p><i style=\"color: rgb(32, 33, 34); font-family: sans-serif;\"><b>Vivy: Fluorite Eye\'s Song</b></i><sup id=\"cite_ref-2\" class=\"reference\" style=\"line-height: 1; unicode-bidi: isolate; white-space: nowrap; font-size: 11.2px; color: rgb(32, 33, 34); font-family: sans-serif;\"><a href=\"https://id.wikipedia.org/wiki/Vivy:_Fluorite_Eye%27s_Song#cite_note-2\" style=\"text-decoration-line: none; color: rgb(6, 69, 173); background: none;\">[a]</a></sup><span style=\"color: rgb(32, 33, 34); font-family: sans-serif;\">&nbsp;adalah serial&nbsp;</span><a href=\"https://id.wikipedia.org/wiki/Anime\" title=\"Anime\" style=\"text-decoration-line: none; color: rgb(6, 69, 173); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-family: sans-serif;\">anime</a><span style=\"color: rgb(32, 33, 34); font-family: sans-serif;\">&nbsp;yang diproduksi oleh&nbsp;</span><a href=\"https://id.wikipedia.org/wiki/Wit_Studio\" title=\"Wit Studio\" style=\"text-decoration-line: none; color: rgb(6, 69, 173); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-family: sans-serif;\">Wit Studio</a><span style=\"color: rgb(32, 33, 34); font-family: sans-serif;\">&nbsp;dan dibuat oleh&nbsp;</span><a href=\"https://id.wikipedia.org/w/index.php?title=Tappei_Nagatsuki&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"Tappei Nagatsuki (halaman belum tersedia)\" style=\"text-decoration-line: none; color: rgb(221, 51, 51); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-family: sans-serif;\">Tappei Nagatsuki</a><span style=\"color: rgb(32, 33, 34); font-family: sans-serif;\">&nbsp;berkolaborasi dengan Eiji Umehara. Ditayangkan dari 3 April hingga 19 Juni 2021. Adaptasi&nbsp;</span><a href=\"https://id.wikipedia.org/wiki/Manga\" title=\"Manga\" style=\"text-decoration-line: none; color: rgb(6, 69, 173); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-family: sans-serif;\">manga</a><span style=\"color: rgb(32, 33, 34); font-family: sans-serif;\">&nbsp;oleh Morito Yamataka memulai serialisasi di situs web Mag Comi&nbsp;</span><a href=\"https://id.wikipedia.org/w/index.php?title=Mag_Garden&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"Mag Garden (halaman belum tersedia)\" style=\"text-decoration-line: none; color: rgb(221, 51, 51); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-family: sans-serif;\">Mag Garden</a><span style=\"color: rgb(32, 33, 34); font-family: sans-serif;\">&nbsp;pada 10 April 2021,</span><sup id=\"cite_ref-ANN1_3-0\" class=\"reference\" style=\"line-height: 1; unicode-bidi: isolate; white-space: nowrap; font-size: 11.2px; color: rgb(32, 33, 34); font-family: sans-serif;\"><a href=\"https://id.wikipedia.org/wiki/Vivy:_Fluorite_Eye%27s_Song#cite_note-ANN1-3\" style=\"text-decoration-line: none; color: rgb(6, 69, 173); background: none;\">[2]</a></sup><span style=\"color: rgb(32, 33, 34); font-family: sans-serif;\">&nbsp;sedangkan seri novel yang ditulis oleh Tappei Nagatsuki dan Eiji Umehara dengan ilustrasi yang dibuat oleh loundraw mulai diterbitkan di bawah cetakan Novel WIT pada tanggal 30 April 2021.</span><br></p>', 3, 1, '2022-6-23', '2022-07-22 18:34:54', '2022-07-22 18:34:54'),
(5, 'Rambut biru sangat menarik', 'rambut-biru-sangat-menarik', '36895vivy.jpg', '<p style=\"overflow-wrap: break-word; font-family: Lato; font-size: 12px; line-height: 1.5; margin-right: 0px; margin-bottom: 26px; margin-left: 0px; color: rgb(72, 73, 74);\"><span style=\"line-height: 1.5; font-size: 12pt;\">WIT Studio has released the pilot movie for its Spring 2021 anime <a href=\"https://anitrendz.net/news/?s=Vivy+Fluorite+Eye%E2%80%99s+Song\" style=\"background-color: transparent; color: rgb(234, 152, 63); text-decoration-line: none;\"><em>Vivy -Fluorite Eye’s Song-</em></a>.</span></p><p style=\"overflow-wrap: break-word; font-family: Lato; font-size: 12px; line-height: 1.5; margin-right: 0px; margin-bottom: 26px; margin-left: 0px; color: rgb(72, 73, 74);\"><span style=\"line-height: 1.5; font-size: 12pt;\">The dialogue-less pilot includes scenes of Vivy facing off against the series’ Estella and Yugo Kakitani, as well as a scene of Vivy writing a song inside the Archive.</span></p><p><figure class=\"wp-block-embed is-type-video is-provider-youtube wp-block-embed-youtube wp-embed-aspect-16-9 wp-has-aspect-ratio\" style=\"margin-bottom: 1em; overflow-wrap: break-word; color: rgb(72, 73, 74); font-family: Trebuchet, Tahoma, Arial, sans-serif; font-size: 12px;\"></figure></p><p style=\"box-sizing: border-box; overflow-wrap: break-word; font-family: Lato; font-size: 12px; line-height: 1.5; margin: 0px 0px 26px; color: rgb(72, 73, 74); font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\"><span style=\"box-sizing: border-box; font-family: Lato; line-height: 1.5; font-size: 12pt;\">The pilot movie was previously mentioned in a<span> </span><a href=\"https://vivy-anime.com/special/roundtable_discussion_02/\" target=\"_blank\" rel=\"noopener\" style=\"box-sizing: border-box; background-color: transparent; color: rgb(234, 152, 63); text-decoration: none;\">roundtable discussion</a><span> </span>published on the anime’s website, where<span> </span><em style=\"box-sizing: border-box;\">V<span style=\"box-sizing: border-box; font-family: Lato; line-height: 1.5; font-size: 12pt;\">ivy</span></em>‘s music composer, Satoru Kōsaki, was mentioned to have “started off by composing a song for the pilot film.” However, the publicly released pilot features instrumental music instead of the “ballad” that the roundtable mentions.</span></p>', 3, 1, '2022-6-23', '2022-07-22 18:36:44', '2022-07-22 18:36:56');

